import React from 'react';
import './Navbar.css';

const Slider = () => {
  return (
    <div>
   
  <div class="slider">
    <ul>
      <li><img src="images/universal.jpg" alt="" /></li>
      <li><img src="images/1.jpg" alt="" /></li>
      <li><img src="images/2.jpg" alt="" /></li>
      <li><img src="images/8.jpg" alt="" /></li>
    </ul>
  </div>

    </div>
  );
}

export default Slider;
